import './App.css';
import Navbar from './Component/Navbar';
import Grid from '@mui/material/Grid';
import fblogo from '../src/images /logo.png';



function App() {
  return (
    <div className="App">
    {/* <Navbar subject="ishaan"/> */}
      <Grid container>
          <Grid item xs={3}>
            <div>
              <img src={fblogo} width="35px"/>
              <input type="text"/>
            </div>

          </Grid>
          <Grid item xs={6}>g2</Grid>
          <Grid item xs={3}>g3</Grid>

      </Grid>
    </div>
  );
}

export default App;
